# EM_PPC (function bar 0x100004c0)
# Note. Only in .debug_frame, not in .eh_frame.
#
# = bar.c =
#
# static int b1 = 1;
# int b2 = 1;
#
# static int
# foo (int a)
# {
#   return a + b2;
# }
#
# int bar (int b)
# {
#   return b - foo (b - b1);
